            {
                Value = bilirubin,
                Rms = 10.5 * 0.01 * bilirubin,
                Name = "Bilirubin",
                Description = "mG/liter"
            };
            @params.Add(param);

            return @params;

        }

        public  IEnumerable<Params> GetParams(ExperimentEntityDataViewModel data)
